//useful function
void toggle_state(uint8_t *state) {
    *state = (*state == 0) ? 1: 0;
    return;
} 



//界面绘制
void display_picture(uint16_t x, uint16_t y, uint16_t width, uint16_t height, const uint8_t *image)
{
    uint32_t cnt = 0;

    for (uint16_t i=0; i<height; i++)   // 一行一行地显示
    {
        
        for (uint16_t j = 0; j < width; j++)                        // 一行中，从左到事，逐个像素处理
        {
            ILI9341_OpenWindow(j,i,1,1);
            ILI9341_Write_Cmd(CMD_SetPixel);                 // 开始写GRAM
            ILI9341_Write_Data((image[cnt * 2 + 1] << 8) | image[cnt * 2]);  // 写入16位颜色数据
            cnt++;
        }
    }
}
void main_page(){
    display_picture(0,0,240,320,mainpage);
}
void gesture_page(){
    display_picture(0,0,240,320,gesturepage);
}

void show_page(){
    display_picture(0,0,240,100,showpage);
}






