//显示动画
void gesture_dir_arrow(const TCHAR* path){
    FRESULT res;
    // DWORD fileSize;  

    // char test[300];
    res = f_mount(&SDFatFS,"0:/",1);
    res = f_open(&SDFile, path, FA_READ);
    // sprintf(test,"%d",res);
    // ILI9341_DispString_EN(0,0,test);
    if (res == FR_OK)
    {
        // fileSize = f_size(&SDFile);
        while (1)
        {
            for (x = 0; x < ((TOTAL_BYTE % BUFF_TOTAL_BYTE) ? (TOTAL_BYTE / BUFF_TOTAL_BYTE) + 1 : (TOTAL_BYTE / BUFF_TOTAL_BYTE)); x++)
            {
                f_lseek(&SDFile, move);
                res = f_read(&SDFile, buff, BUFF_TOTAL_BYTE, &brr);

                LCD_Draw_Picture_Pro(&xstr, &ystr, brr, buff);
                move += brr;
                
            }
            if (brr < BUFF_TOTAL_BYTE) break;
        }

        f_close(&SDFile);  // 关闭文件
        move = 0;//复位

    }
}